export const updateTradeResult = (state, payload) => {
state.purchase += parseFloat(payload.purchase) * parseInt(payload.count);
  state.sale += parseFloat(payload.sale) * parseInt(payload.count);
  state.purchase += parseFloat(payload.purchase) * parseInt(payload.count);

}
